import React from 'react';

export default function Card({ fullname,title, family,imageUrl}) {
  return (
    <div>
        <h3>{fullname}</h3>
        <h5>{title}</h5>
        <h5>{family}</h5>
        <img src= {imageUrl}  alt="img not found"/>
    </div>
  );
}
